import './Team.css'

const Team = (props) => {

    const colorSecondary = { backgroundColor: props.colorSecondary }
    const colorPrimary = { borderColor: props.colorPrimary }

    return (
        <section className="team" style={{ backgroundColor: colorSecondary }}>
            <h3 style={{ borderColor: props.colorPrimary}}>{props.name}</h3>
        </section>
    )
}

export default Team
